import React, { Component } from 'react';
class ListOfProjects extends Component {
    constructor(props) {
        super(props);
        this.press = this.press.bind(this);
    }
    press(){
        console.log(this.press);
        alert("Hello React!")
    }
    render() {
        return (
            <div >
                    <div id="im">
                        <img className="foto" src={this.props.photo} onClick={this.press} />
                         <p>{this.props.name}</p> 
                    </div>
            </div>
        );
    }
}

export default ListOfProjects;
